import { Outlet, useLoaderData, Form, Link } from "react-router-dom"
import Welcome from "../components/Welcome"
import classes from "./ROOTELEMENT.module.css"
import nikelogo from "../extra-data/nike.svg"

const RootElement = () => {
    const token = useLoaderData();
    return (
        <div>
            <div className={classes.nike}>
                <img src={nikelogo} />
                <Link to="auth?mode=login"><button>{!token && <button>Sign in</button>}</button></Link>
                {token && <Form action="/logout" method="post"><button>Log Out</button></Form>}
            </div>
            <Welcome />
            <Outlet />
        </div>
    )
};

export default RootElement
